let $scope;

self.onInit = function() {
    $scope = self.ctx.$scope;
    let $injector = $scope.$injector;
    let $q = $injector.get('$q');
    let $http = $injector.get('$http');
    let $location = $injector.get('$location');
    let $deviceService = $injector.get('deviceService');
    let $userService = $injector.get('userService');
    let toast = $scope.$injector.get('toast');
    let utils = $scope.$injector.get('utils');
    let $translate = $scope.$injector.get('$translate');
    let $rootScope = $scope.$injector.get('$rootScope');
    let settings = self.ctx.settings || {};
    $scope.secretKeyField = settings.deviceSecret;
    $scope.showLabel = settings.showLabel;
    $scope.deviceObj = {};

    const config = {
        ignoreErrors: true
    };

    let titleTemplate = "";
    let successfulClaim = utils.customTranslation(
            settings.successfulClaimDevice, settings
            .successfulClaimDevice) || $translate
        .instant(
            'widgets.input-widgets.claim-successful');
    let failedClaimDevice = utils.customTranslation(
        settings.failedClaimDevice, settings
        .failedClaimDevice) || $translate.instant(
        'widgets.input-widgets.claim-failed');
    let deviceNotFound = utils.customTranslation(
        settings.deviceNotFound, settings
        .deviceNotFound) || $translate.instant(
        'widgets.input-widgets.claim-not-found');

    if (settings.widgetTitle && settings.widgetTitle
        .length) {
        titleTemplate = utils.customTranslation(settings
            .widgetTitle, settings.widgetTitle);
    } else {
        titleTemplate = self.ctx.widgetConfig.title;
    }
    self.ctx.widgetTitle = titleTemplate;

    $scope.deviceLabel = utils.customTranslation(
        settings.deviceLabel, settings.deviceLabel
    ) || $translate.instant(
        'widgets.input-widgets.device-name');
    $scope.requiredErrorDevice = utils
        .customTranslation(settings.requiredErrorDevice,
            settings.requiredErrorDevice) || $translate
        .instant(
            'widgets.input-widgets.device-name-required'
        );

    $scope.secretKeyLabel = utils.customTranslation(
        settings.secretKeyLabel, settings
        .secretKeyLabel) || $translate.instant(
        'widgets.input-widgets.secret-key');
    $scope.requiredErrorSecretKey = utils
        .customTranslation(settings
            .requiredErrorSecretKey, settings
            .requiredErrorSecretKey) || $translate
        .instant(
            'widgets.input-widgets.secret-key-required'
        );

    $scope.labelClaimButon = utils.customTranslation(
        settings.labelClaimButon, settings
        .labelClaimButon) || $translate.instant(
        'widgets.input-widgets.claim-device');

    $scope.claim = () => {
        $scope.loading = true;
        //Antepongo la P al nombre del dispositivo
        claimDevice("P" + $scope.deviceObj
            .deviceName, $scope.deviceObj
            .deviceSecret, config).then(
            (data) => {
                //console.log(data);
                //Después de reclamarlo tenemos que guardar el nombre original en el atributo originalName
                //cambiarle: nombre y padre
                //Y crear las relaciones con el Customer
                //Obtengo el token del dispositivo SYSTEM
                $deviceService
                    .getCustomerDevices(
                        $userService
                        .getCurrentUser()
                        .customerId, {
                            "limit": 100
                        }, false, {}, 'SYSTEM')
                    .then(
                        function(dataSystem) {
                            if (dataSystem.data
                                .length == 1) {
                                $deviceService
                                    .getDeviceCredentials(
                                        dataSystem
                                        .data[0]
                                        .id.id,
                                        true, {}
                                    ).then(
                                        function(
                                            response
                                        ) {
                                            reasignar
                                                (response
                                                    .credentialsId,
                                                    data
                                                    .device
                                                    .id
                                                    .id,
                                                    "P" +
                                                    $scope
                                                    .deviceObj
                                                    .deviceName,
                                                    data
                                                    .device
                                                    .type
                                                );


                                        });
                            }
                        });



            },
            (error) => {
                $scope.loading = false;
                if (error.status == 404) {
                    toast.showError(
                        deviceNotFound,
                        angular.element(
                            '.claim-form'),
                        'bottom left');
                } else if (error.status ==
                    400) {
                    toast.showError(
                        failedClaimDevice,
                        angular.element(
                            '.claim-form'),
                        'bottom left');
                }
            }
        );
    }

    function reasignar(tokenControl, claimedDeviceId,
        claimedDeviceName, claimedDeviceSubtype) {
        //console.log(vm.attributes);
        servicioHTTP({
            method: 'POST',
            url: $location.protocol() + '://' +
                $location.host() +
                '/api/v1/' +
                tokenControl +
                '/telemetry',
            data: "{'accion':'reclamarDispositivo','idEntidad':'" +
                claimedDeviceId +
                "','nombreEntidad':'" +
                claimedDeviceName +
                "','subtipoEntidad':'" +
                claimedDeviceSubtype + "'}"
        }).
        success(function(data, status, headers,
            config) {
            successClaim();
            console.log('worked');
            updateAliasData();
            $scope.form.editEntityForm
                .$setPristine();
            $mdDialog.hide();
            // ...
        }).
        error(function(data, status, headers,
            config) {
            console.log('notworked');
            // ...
        });


        //saveAttributes();
        //saveRelations();
        //$scope.editEntityForm.$setPristine();
    };

    function claimDevice(deviceName, deviceSecret,
        config) {
        let deferred = $q.defer();
        let url = "/api/customer/device/" + deviceName +
            "/claim";
        let obj = deviceSecret ? {
            secretKey: deviceSecret
        } : {};
        $http.post(url, obj, config).then(
            (payload) => {
                deferred.resolve(payload.data);
            },
            (error) => {
                deferred.reject(error);
            }
        );
        return deferred.promise;
    }

    function updateAliasData() {
        var aliasIds = [];
        for (var id in self.ctx.aliasController
                .resolvedAliases) {
            aliasIds.push(id);
        }
        var tasks = [];
        aliasIds.forEach(function(aliasId) {
            self.ctx.aliasController
                .setAliasUnresolved(aliasId);
            tasks.push(self.ctx.aliasController
                .getAliasInfo(aliasId));
        });
        $q.all(tasks).then(function() {
            $rootScope.$broadcast(
                'widgetForceReInit');
        });
    }

    function successClaim() {
        resetForm();
        $scope.claimDeviceForm.$setPristine();
        $scope.claimDeviceForm.$setUntouched();
        $scope.loading = false;
        toast.showSuccess(successfulClaim, 2000);
        updateAliasData();
    }

    function resetForm() {
        $scope.deviceObj = {};
    }
}

